function Home() {
return (
<div
style={{
minHeight: '80vh',
display: 'flex',
flexDirection: 'column',
alignItems: 'center',
paddingTop: 64,
}}
>
<h1 className="neon-flicker">
TymoshchukMateStore
</h1>

<div
style={{
marginTop: 48,
display: 'flex',
justifyContent: 'center',
width: '100%',
}}
>
<img
src="/img/banner/hero-headphones.webp"
alt="Wireless headphones"
style={{
width: 520,
maxWidth: '90%',
transform: 'translateX(-40px)',
filter:
'drop-shadow(0 0 18px rgba(255,255,255,0.25)) drop-shadow(0 0 36px rgba(140,100,255,0.35))',
transition: 'all 0.6s ease',
}}
/>
</div>
</div>
);
}

export default Home;
